DESCRIPTION:
Prašau įrengti kelio ženklą draudžiantį sustoti ir stovėti. Važiuojant Virbeliškių g. link Grigalaukio g. nuolat yra avaringos situacijos. Automobiliams sunku prasilenkti nes iš abiejų pusių yra paliktos transporto priemonės prie pat sankryžos. 

150. Sustoti ir stovėti draudžiama:
150.8. sankryžoje ir arčiau kaip 5 m atstumu nuo jos, išskyrus tuos atvejus, kai ten stovėti leidžia stovėjimo vietą nurodantys kelio ženklai;
